                aria-label='Close'
                type='button'
                onClick={() => console.log('Close button has been clicked')}
                style={{
                    position: 'absolute',
                    right: '16px',
                    top: '16px',
                    cursor: 'pointer',
                    maxHeight: '17px',
                    background: 'transparent',
                    border: 'none'
                }}
            >
                <img
          src={Closeicon}
          alt='close-icon'
          style={{
            position: 'relative',
            maxHeight: '12px',
            background: 'transparent',
            border: 'none',
          }}
        />
            </button>
        </div>

    );
}
